import React from 'react';
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
} from './NavbarElements';
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <Bars />
  
        <NavMenu>
          <NavLink to='/' activeStyle>
            INDEX.HTML
          </NavLink>
          <NavLink to='/events' activeStyle>
            INDEX.CSS
          </NavLink>
          <NavLink to='/annual' activeStyle>
            INDEX.JS
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};
  
export default Navbar;
